$(function(){
	var x = document.cookie;

	if(x != '' || x != null){
		var z = getCookieValue(x);
	}

	// document.cookie = "kk_popup=; expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/;"; 
	// console.log(document.cookie);

	if(!z){
    	idleTimer = setTimeout(function () { 
	        $('#comfortableDreams').modal('show');
	        x = false;
	        document.cookie = "kk_popup=1";
	    }, 5000);
    } 
});

function getCookieValue(x){
	var data = x.split('; ');

	if(data.length > 0){
		for(var y = 0; y < data.length; y++){
			if( data[y].match(/kk_popup/) ){
				return true;
			}
		}
	}

	return false;
}

$(function(){
