	// if(video.paused){
	//   video.play();
	// } else {
	//   alert('playing');
	// }

	video.play();
	$(this).css('display', 'none');
	$('.pause_btn').css('display', 'block');

	return false;
  });
  $('.pause_btn').click(function(){
	video.pause();
	$(this).css('display', 'none');
	$('.play_btn').css('display', 'block');
	return false;
  });
});

